body {
	font-family: "EB Garamond", serif;
	background-color: var(--color-background);
	overflow-x: hidden;
}

:root {
	/* color  */
	--color-background: #0b0e17;
	--color-white: #fff;
	--color-primary-1: #ffc978;
	--color-primary-2: #ffaf76;
	--color-primary-3: #abaeb7;

	/* font-weight */
	--fw-500: 500;
	--fw-400: 400;
	--fw-300: 300;
	--fw-200: 200;

	/* font size */
	--fs-rem-1: 0.7rem;
	--fs-rem-2: 1rem;
	--fs-rem-3: 1.5rem;
	--fs-rem-4: 1.75rem;
	--fs-rem-5: 2.5rem;
	--fs-rem-6: 3rem;
}

.inner-container {
	width: min(100%, 1000px);
	/* width: 1000px; */
	margin: 0 auto;
	/* border: 1px solid blue; */
}

.heading-1 {
	font-size: calc(5vw - 1.5rem);
	color: var(--color-white);
	font-family: "Lucida Sans", "Lucida Sans Regular", "Lucida Grande",
		"Lucida Sans Unicode", Geneva, Verdana, sans-serif;
	text-transform: uppercase;
}

.heading-3 {
	font-size: var(--fs-rem-1);
	font-weight: 400;
	text-transform: uppercase;
	color: var(--color-primary-2);
}
.heading-2 {
	font-weight: 400;
	color: var(--color-white);
	text-transform: uppercase;
	font-size: 2rem;
}

.primary-lead {
	color: var(--color-primary-1);
	font-size: var(--fs-rem-2);
	text-transform: uppercase;
}

.heading-6 {
	font-size: var(--fs-rem-4);
	font-weight: 400;
	text-transform: uppercase;
	color: var(--color-white);
}

.navbar {
	position: fixed;
	width: 100%;
	z-index: 100;
	scroll-behavior: smooth;

	justify-content: space-around;
}

.nav-link {
	margin-left: 4rem;
	font-size: 1.5rem;
	list-style: none;
	color: var(--color-white);
	transition: all 0.5s ease-in-out;
}

.nav-link:hover {
	/* border: 1px solid var(--color-primary-1); */
	color: var(--color-primary-1);
}

.collapse {
	margin-left: 3rem;
}

.btn {
	border: 1px solid var(--color-white);
	color: var(--color-white);
	font-size: var(--fs-rem-1);
	transition: all 0.5s ease-in-out;
}

.btn:hover {
	padding: 1rem 1.5rem;
	background-color: var(--color-primary-1);
}

.nav-btn {
	padding: 0.5rem 1.5rem;
	margin-right: 5rem;
}

.nav-bg {
	background-color: var(--color-background);
	opacity: 0.5;
}
.container {
	/* width: min(100%, 1920px);
	margin: 0 auto; */
	max-width: 1920px;
	width: calc(100vw - 5rem);
	background-color: var(--color-background);
	/* background: linear-gradient(var(--color-background), var(--color-primary-3)); */
	padding: 0;
}

.design {
	padding-top: 10rem;
	padding-left: 1.5rem;
}
.design-img {
	width: 59.67vw;
	height: calc(100% - 1rem);
	margin: 0 calc(5vw - 10%);
	object-fit: contain;
}

.paragrapgh-text {
	color: var(--color-primary-3);
	/* font-size: var(--fs-rem-2); */
	font-size: calc(1.7vw - 0.3rem);
	line-height: calc(22 + 1rem);
	max-width: 28rem;
	font-family: "Roboto", sans-serif;
	margin: 1rem 0;
}

.interior {
	position: absolute;
	left: -27vw;
	top: 45.5vw;
	font-size: calc(7vw - 0.6rem);
	width: 50vw;
	margin: 0 calc(-21.5vw + 50%);
	/* margin-top: calc(2vw + 15%); */
	text-transform: uppercase;
	color: rgba(27, 32, 48, 0.4);
	bottom: -6rem;
}

/* Servirc section */
.services {
	margin: 7rem 0;
	text-align: center;
	/* width: 1000px; */
}

.services-img {
	width: 100%;
	/* height: 350px; */
	margin-top: 2rem;
	object-fit: cover;
	margin-top: 5rem;
}

.trans-up {
	transform: translateY(-30%);
}

/* About section */
.about {
	margin-bottom: 17rem;
}
.vertical-line {
	border-left: 1px solid hsla(0, 0%, 100%, 0.144);
	box-shadow: inset;
	padding-left: 1.5rem;
	margin-left: 2.5rem;
	position: relative;
}

@media (min-width: 500px) {
	.vertical-line::before {
		content: "";
		position: absolute;
		top: 0;
		bottom: 0;
		left: 0;
		width: 0.7px;
		background-image: linear-gradient(
			to bottom,
			transparent,
			#fff,
			transparent
		);
	}
}

.about-client {
	width: 1rem;
	display: inline-block;
	margin-left: 2rem;
	color: var(--color-primary-3);
}

.about-rating {
	font-size: 6rem;
	color: var(--color-white);
	display: inline-block;
}

.about-rating span {
	font-size: var(--fs-rem-5);
}

.review .row {
	margin-top: 1rem;
	max-width: 500px;
}

.about-img-1 {
	width: 320px;
	height: 120px;
	object-fit: cover;
}

.about-img-2 {
	width: 160px;
	height: 140px;
}
.img-collection {
	width: 100%;
	/* height: 350px; */
	object-fit: cover;
}

.trans {
	transform: translateY(26%);
}

.project {
	margin-top: 3rem;
}

.project .nav-link {
	font-size: var(--fs-rem-1);
	transition: all 0.8s ease;
	border-radius: 0;
	padding: 0;
}

.project .nav-link:hover,
.project .nav-link:focus {
	color: var(--color-primary-1);
	border-bottom: 1px solid var(--color-primary-1);
}

.nav-active {
	border: none;
	color: var(--color-primary-1);
	border-bottom: 1px solid var(--color-primary-1) !important;
}

.img-container {
	/* border: 1px solid green; */
	max-width: 250px;
	/* height: calc(350px - 5v%); */
}

.project-collection {
	width: 100%;
	/* height: calc(350px - 1vw); */
	height: inherit;
	object-fit: cover !important;
}
.project-collection:nth-child(2),
.project-collection:nth-child(4) {
	transform: translateY(10%);
}

/* .project-size {
	max-width: 700px;
} */

.digital {
	/* width: 1400px; */
	max-width: 100vw;
	/* width: 100vw; */
	/* width: calc(100vw - 0.6rem); */
	/* width: calc(1920px - 5rem); */
	margin: 5rem calc(-50vw + 50%);
	height: 350px;
	background-color: #1a1d26;
	margin-top: 4rem;
	/* padding: 2.5rem 6rem; */
	position: relative;
	/* z-index: 1; */
	/* overflow: hidden; */
}

.digital-img {
	width: 350px;
	height: 250px;
	margin: 0 5rem;
}

.digital-review {
	font-size: var(--fs-rem-5);
	color: var(--color-primary-1);
	padding: 0;
}

.digital-review span {
	font-size: var(--fs-rem-3);
	padding: 0;
}

.digital-R {
	/* width: 350px; */
	height: 350px;
	padding: 0;
	position: absolute;
	top: 0;
	right: 0;
	overflow: hidden;
}

.digital-R span {
	font-size: 33.5rem;
	position: absolute;
	top: -14.3rem;
	right: 1rem;
	color: #0b0e17;
	font-family: "Times New Roman", Times, serif;
}

.project-list-img {
	max-width: 1200px;
	height: 300px;
	margin: 0 calc(-20vw + 15%);
	border: 1px solid green;
}

.img-lists {
	display: flex;
}

/* .project-lead::after {
	content: "";
	width: 2px;
	height: 150px;

	background: linear-gradient(
		180deg,
		rgba(171, 174, 183, 0) 0%,
		#abaeb7 51.56%,
		rgba(171, 174, 183, 0) 100%
	);
	display: inline-block;
} */

.project-lead {
	border-left: 1px solid
		linear-gradient(
			180deg,
			rgba(171, 174, 183, 0) 0%,
			#abaeb7 51.56%,
			rgba(171, 174, 183, 0) 100%
		);
	/* display: inline; */
}

.table-row {
	gap: 2rem;
}

.table-header {
	color: var(--color-primary-1);
}

.table-data {
	padding: 4rem;
	color: var(--color-white);
}

.table-row:hover > * {
	color: var(--color-primary-1);
}

.img-wrapper {
	max-height: 295px;
	padding: 0;
	margin-top: 1rem;
	margin-left: 1vw;
}

.img-wrapper img {
	width: 100%;
	height: 350px;
	object-fit: cover;
}

@media (max-width: 767px) {
	/* .container {
		width: 435px;
	} */

	.design-img {
		width: 100vw;
		margin: 1rem calc(-50vw + 50%);
	}

	.inner-container {
		max-width: 600px;
		margin: 0 auto;
		margin-top: 3rem;
		padding: 2rem;
	}
	.project-size {
		width: 400px;
	}

	.project-collection {
		width: 150px;
		height: 200px;
	}

	.heading-2 {
		font-size: 1rem;
	}

	.services {
		text-align: start;
		width: 100%;
		/* border: 1px solid blue; */
		margin: 0;
		margin-top: 3rem;
	}
	/* .about {
		width: 400px;
		margin-top: 3rem;
		padding: 1rem;
	} */

	.about .lead {
		padding: 0;
		margin: 0;
		border-left: none;
		font-size: 0.8rem;
		width: 100%;
	}

	.img-collection {
		width: 190px;
		height: 250px;
	}

	.review {
		margin-top: 6rem;
	}

	.review-heading {
		font-size: var(--fs-rem-6);
		color: var(--color-white);
		display: inline-block;
	}

	.about-client {
		display: inline-block;
		margin-left: 2rem;
		width: 2rem;
		font-size: var(--fs-rem-2);
		color: var(--color-white);
	}

	.about-img-1 {
		width: 100%;
		height: 100%;
	}

	.about-img-2 {
		display: none;
	}

	/* .project {
		width: 400px;
		margin-top: 3rem;
		padding: 1rem;
	} */

	.project ul {
		justify-content: space-around;
	}

	.project-collection {
		width: 190px;
		height: 250px;
	}
	/* 
	.carousel {
		width: 300px;
		height: 350px;
	} */

	.digital-R {
		display: none;
	}
}
